import React from 'react';
import { BrowserRouter as Router, Switch, Route, Link } from 'react-router-dom';

const CloseButton = () => {
    return (
      <button onClick={() => window.close()}>Close Application</button>
    );
}

const About = () => {
    return (
      <div>
        <h2>About Page</h2>
        <Link to="/">Go to Home Page</Link>
      </div>
    );
}

const Navbar = () => {
    return (
      <nav style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', backgroundColor: '#333', color: '#fff' }}>
        <ul style={{ listStyle: 'none', display: 'flex', justifyContent: 'space-between', alignItems: 'center' }}>
          <li><Link to="/">Close Button</Link></li>
          <li><Link to="/about">About</Link></li>
        </ul>
      </nav>
    );
}

const App = () => {
    return (
      <Router>
        <Navbar />
        <Switch>
          <Route exact path="/" component={CloseButton} />
          <Route exact path="/about" component={About} />
        </Switch>
      </Router>
    );
}

export default App;
